import { Container } from 'semantic-ui-react';
class Content extends React.Component{
    constructor(){
        this.state = {value:'0'}
    }
    render(){
        if(this.state.value===0)
        return (
            <Container textAlign="center">
                {this.state.value}
            </Container>
        );
    }
}

export default Content;
